import { Button, CardContent, Typography } from "@mui/material";
import Card from "@mui/material/Card";

const Dashboard = () => {
  return (
    <div>
      <Card sx={{width:"10rem"}}>
        <CardContent sx={{display: "flex", justifyContent: "center"}}>
          <Typography>Wallet Balance: &#x20B9; 4500</Typography>
          <Button sx={{color : "#fff",backgroundColor: "rgba(181, 220, 82, 1)", borderRadius:"15px"}}>+ Add Income</Button>
        </CardContent>
      </Card>
    </div>
  );
};

export default Dashboard;
